import React, { Fragment, useLayoutEffect } from 'react'

const Layout = ({ children }) => {
    const nav = () => {
        <ul className="nav nav-tabs bg-primary">
            <li className="nav-item">
                <a href="/" className="text-light"></a>
            </li>
        </ul>
    }
    return (
        <Fragment>
            <p>
                This is nav
            </p>
            <div className="Container">
                {children}
            </div>
        </Fragment>
    )
}

export default Layout;
